body {
    background-color: #ffffff;
}

.header {
    &__inner {
        display: flex;
        justify-content: space-between;
        align-items: center;
    }
}

.logo {
    margin-right: 251px;
}

.menu {
    &__list {
        display: flex;
    }
    &__list-item {
        padding-left: 20px;
    }
    &__list-link {
        color: $darc_shade_50;
    }
}

.arrow {
    border-top: 2px solid;
    display: inline-flex;
    width: 8px;
    height: 8px;
    margin-left: 10px;
    margin-right: 10px;
    border-left: 2px solid;
    border-color: $darc_shade_50;
    transform: rotate( -135deg);
    margin-bottom: 1.8px;
}

.header__btn {
    @extend %bold;
    &-come {
        border-style: solid;
        border-radius: 22px;
        min-width: 87px;
        border-color: $purpl;
        color: $purpl;
        background-color: #ffffff;
        font-size: 12px;
        line-height: 15px;
        text-transform: uppercase;
        padding: 7px 18px 7px 20px;
    }
    &-register {
        margin-left: 20px;
        min-width: 157px;
        border: none;
        border-radius: 22px;
        color: #ffffff;
        background-color: $purpl;
        font-size: 12px;
        line-height: 15px;
        text-transform: uppercase;
        padding: 9px 21px 9px 21px;
    }
}

